import React from 'react';
import { Box, Divider, AbsoluteCenter } from '@chakra-ui/react';


const AboutUs = () => {
    return (
        <Box position='relative' padding='10'>
            <Divider />
            <AbsoluteCenter bg='white' px='4'>
                About Us
            </AbsoluteCenter>
        </Box>
    );
};

export default AboutUs;
